import React, { useState } from "react";

const NavBar = () => {

  function Mostrar(){
      var menu = document.getElementById("mobile-menu");
      
  };

  return (
    <>
      <nav class="bg-principal-color flex items-center justify-between p-4">
 
      <div class="text-white text-xl font-bold">ProVision</div>
  
      <div class="hidden md:flex space-x-4">
        <a href="#" class="rounded-md px-3 py-2 text-sm font-medium text-white hover:bg-gray-700 hover:text-white hover:bg-blue-500">Dashboard</a>
        <a href="#" class="rounded-md px-3 py-2 text-sm font-medium text-white hover:bg-gray-700 hover:text-white hover:bg-blue-500">Team</a>
        <a href="#" class="rounded-md px-3 py-2 text-sm font-medium text-white hover:bg-gray-700 hover:text-white hover:bg-blue-500">Projects</a>
        <a href="#" class="rounded-md px-3 py-2 text-sm font-medium text-white hover:bg-gray-700 hover:text-white hover:bg-blue-500">Calendar</a>
      </div>
      
      <button id="menu">
        <img class="h-8 w-8 rounded-full" src="https://thumbs.dreamstime.com/b/l%C3%ADnea-icono-del-negro-avatar-perfil-de-usuario-121102131.jpg" alt="Not found"/>
      </button>

      <div id="mobile-menu" class="md:hidden fixed inset-0 bg-white flex flex-col items-center space-y-4 p-4 hidden">
        <a href="#" class="text-black text-lg font-medium hover:bg-gray-200 rounded-md px-4 py-2">Dashboard</a>
        <a href="#" class="text-black text-lg font-medium hover:bg-gray-200 rounded-md px-4 py-2">Team</a>
        <a href="#" class="text-black text-lg font-medium hover:bg-gray-200 rounded-md px-4 py-2">Projects</a>
        <a href="#" class="text-black text-lg font-medium hover:bg-gray-200 rounded-md px-4 py-2">Calendar</a>
      </div>
    </nav>
    </>
  );
};

export default NavBar;
